 import React, {Component} from 'react'
 import App from './App';

class Greet extends Component { 

 render(){

return(

	     <div className="App">
      <Greet name="Aditya" sirname="Mishra">
      <p>I am a programmer</p>
      </Greet>
      <Greet name="Sagar"  sirname="Kumar">
       <button>Click me</button>
      </Greet>
      <Greet name="Sonam"  sirname="sharma">
       <p>I am a Designer</p>
      </Greet>
     </div>

    	

    	)


 }

    

}
 
 
 export default Greet;
